import ReactDOM from 'react-dom';
import { Container, AppBar, Typography, } from "@material-ui/core";
import App from './App';

ReactDOM.render(
    <Container maxWidth="lg" disableGutters="true">
        <App />
    </Container>,
    document.getElementById('root')
);
